    if (props.nivelfinal !== 5) {
        return null
    }
      return(
        <div>
          <h3>Caro(a) {props.nome}</h3>
          Infelizmente por causa de seu peso voce não pode doar sangue, volte quando voce tiver mais que 50 quilos. 
          </div>
      )
}

